import React, { Fragment } from "react";
import MealItem from './MealItem';
import classes from './MealSummary.module.css';

const DUMMY_MEALS = [
    {
      id : 1,
      name : 'a',
      description : "Lorem ipsum dolor sit amet.",
      price : 10.22
    },
    {
      id : 2,
      name : 'b',
      description : "Feature 2: Consectetur adipiscing elit.",
      price : 11.11
    },
    {
      id : 3,
      name : 'c',
      description : "Feature 3: Integer molestie sapien a justo ullamcorper.<",
      price : 12.777
    },
    {
      id : 4,
      name : 'd',
      description : "Feature 4: Sed sit amet lectus vel diam aliquam eleifend.",
      price : 13.22
    }
]


const MainSummary = props => {
    const mealItems = DUMMY_MEALS.map((meal) => <MealItem key = {meal.id} name = {meal.name} description = {meal.description} price = {meal.description}></MealItem>)
    return <Fragment>
        <div className={classes.meal}>
            <ul>
                {mealItems}
            </ul>
        </div>
    </Fragment>
}


export default MainSummary;
